Over the past 2 months, with your contributions, we have raised close to $1.3 Million. This in turn has provided necessary health care; meals; ration; and now also vaccination support to those most in need across the country. A big thank you to everyone who came forward and contributed to our fundraiser!

Your valiant efforts will now have a bigger impact. Today, I am pleased to announce our partnership with the Bill & Melinda Gates Foundation, who have come forward and is supporting our efforts by matching your contributions so far up to 1M USD through #TogetherForIndia. 

@nickjonas and I are so grateful to Bill & Melinda Gates Foundation for their support and for accelerating our efforts. The funds raised will be used to provide vaccination access to more people, build capacity to setup and maintain oxygen cylinders and concentrators in Aspirational districts, and in Uttar Pradesh, Himachal Pradesh, and Bihar; increase genomic sequencing capacity to identify variants, and provide support to rebuild the livelihoods of the most vulnerable, especially women.

If you have already donated, thank you once again and if you can donate in any capacity then please do come forward and continue to donate!

@give_india  #TogetherForIndia

We are overwhelmed by the support that has come in and as we continue to raise more to support India's healthcare infrastructure, we would also like to extend support to another critical need that has emerged in our battle against Covid 19… fighting Hunger and malnutrition across the country.

@give_india is helping to serve cooked meals and dry rations to municipal wards, municipal staff, orphanages, elderly in need, patients, daily wagers, migrant workers and others in need.

@nickjonas 

